                    </i>
                </div>

                <div className='col-sm'><i className="bi bi-instagram"></i></div>

                <div className='col-sm'><i className="bi bi-whatsapp"></i></div>

            </div>

            {/* Seconda sezione */}
            <div className="footer-bottom">
                <img src={bottomImageUrl} alt="Footer bottom" className="footer-bottom-image" />
